import Rect from 'react';
import { Button, Input } from 'antd';
import "antd/dist/antd.css";
import "./login.css";

export default function Login() {
  return (
    <div className='login-panel'>
      <div className='username-container'>
        <div className='username-label'>用户名</div>
        <Input placeholder="input username" className='username-input' />
      </div>
      <div className='password-container'>
        <div className='password-label'>密码</div>
        <Input.Password placeholder="input password" className='password-input' />
      </div>
      <Button type="primary" className='login'>登陆</Button>
      <div className='password-container'>
        还没账户？<div className='register'>立即注册</div>
      </div>
    </div>
  )
}
